import React, {Component} from 'react';
import {Grid, IconButton, InputAdornment, Typography, TextField, Button} from '@material-ui/core';
import './Register.css';
import {EmailTwoTone, LockTwoTone, Visibility, VisibilityOff} from "@material-ui/icons";

const emailRegex = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;

class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email: null,
            password: null,
            confirmPassword: null,
            showPassword: false,
            showConfirmPassword: false,
            emailError
        };

        this.handleClickShowPassword = this.handleClickShowPassword.bind(this);
        this.handleChange = this.handleChange.bind(this);
        this.handleClickShowConfirmPassword = this.handleClickShowConfirmPassword.bind(this);
        this.emailCheck = this.emailCheck.bind(this);
    }

    handleClickShowPassword() {
        this.setState({
            showPassword: !this.state.showPassword
        });
    }

    handleClickShowConfirmPassword() {
        this.setState({
            showConfirmPassword: !this.state.showConfirmPassword
        });
    }

    handleChange(event) {
        this.setState({
            [event.target.name]: event.target.value,
        });
        this.emailCheck(event);
    }

    emailCheck(event) {

    }

    render() {
        return (
            <div className="Register">
                <Typography variant="h4" gutterBottom>
                    Register
                </Typography>
                <form onSubmit={(event) => this.props.handleSubmit(event, this.state)}>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <EmailTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-email"
                                label="Email"
                                name="email"
                                type="email"
                                onChange={this.handleChange}
                                InputProps={{
                                    "error": this.state.email === null
                                        ? false
                                        : !emailRegex.test(this.state.email),
                                }}
                            />
                        </Grid>
                    </Grid>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <LockTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-password"
                                type={this.state.showPassword ? 'text' : 'password'}
                                label="Password"
                                autoComplete='off'
                                name="password"

                                onChange={this.handleChange}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                aria-label="Toggle password visibility"
                                                onClick={this.handleClickShowPassword}
                                            >
                                                {this.state.showPassword ? <VisibilityOff/> : <Visibility/>}
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        </Grid>
                    </Grid>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <LockTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-confirm-password"
                                type={this.state.showConfirmPassword ? 'text' : 'password'}
                                label="Confirm Password"
                                autoComplete='off'
                                name="confirmPassword"

                                onChange={this.handleChange}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                aria-label="Toggle password visibility"
                                                onClick={this.handleClickShowConfirmPassword}
                                            >
                                                {this.state.showConfirmPassword ? <VisibilityOff/> :
                                                    <Visibility/>}
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        </Grid>
                    </Grid>
                    <Button variant="contained" color="primary" type="submit">
                        Register
                    </Button>
                </form>
            </div>
        )
            ;
    }
}

export default Register;
